    @Test
    public void testTwo() throws Exception {
        //时间复杂度o(n) 准确的说是2n 但是代码量长
        Date date = new Date();
        char[] a = arg.toCharArray();
        int ans = a.length, length = ans;
        for (int i = 0, j = 0; i < length && j < length; ) {
            if (a[i] != '(') {
                i++;
                continue;
            } else {
                j = i > j ? i : j; //j保证比i大
                if (a[j] == ')') {
                    ans = ans - 2;
                    i++;
                }
                j++;
            }
        }
        System.out.println(ans + "=====用时" + (new Date().getTime() - date.getTime()));
    }

